import * as React from 'react';
import styled from '@mui/system/styled';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import MenuIcon from '@mui/icons-material/Menu';
import EditIcon from '@mui/icons-material/Edit';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import Box from '@mui/material/Box';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Inbox from '@mui/icons-material/Inbox';
import DnsRoundedIcon from '@mui/icons-material/DnsRounded';
import Send from '@mui/icons-material/Send';
import Delete from '@mui/icons-material/Delete';
import Info from '@mui/icons-material/Info';
import Drafts from '@mui/icons-material/Drafts';
import SettingsIcon from '@mui/icons-material/Settings';
import Folder from '@mui/icons-material/Folder';
import Button from '@mui/material/Button';
import Avatar from '@mui/material/Avatar';
import Popover from '@mui/material/Popover';

// Constantes para estilos repetidos
const circularIconButtonStyles = {
  borderRadius: '50%',
  backgroundColor: '#F9AA33',
  '&:hover': {
    backgroundColor: '#F9AA33',
  },
  width: '40px',
  height: '40px',
  '@media only screen and (max-width: 600px)': {
    width: '32px',
    height: '32px',
  },
};

const homeIconButtonStyles = {
  ...circularIconButtonStyles,
  marginLeft: '-8px',
};

const itemStyles = {
  py: '2px',
  px: 3,
  color: '#fff',
  '&:hover, &:focus': {
    bgcolor: 'rgba(255, 255, 255, 0.08)',
  },
};

const itemCategoryStyles = {
  boxShadow: '0 -1px 0 rgb(255,255,255,0.1) inset',
  py: 1.5,
  px: 3,
};

const StyledAppBar = styled(AppBar)({
  top: 'auto',
  bottom: 0,
  background: '#1976D2',
  boxShadow: 'none',
  borderTop: '1px solid #FCFCFC',
  position: 'fixed',
  width: '100%',
  '&::before': {
    content: '""',
    position: 'absolute',
    top: '-40%',
    left: '50%',
    transform: 'translateX(-50%)',
    width: '5%',
    height: '100%',
    background: '#FCFCFC',
    borderRadius: '50%',
  },
});

const CenteredBox = styled('div')({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  width: '100%',
  padding: '0 16px',
  '@media only screen and (max-width: 600px)': {
    padding: '0 8px',
  },
});

const CircularIconButton = styled(IconButton)(circularIconButtonStyles);

const HomeIconButton = styled(CircularIconButton)(homeIconButtonStyles);

const ListItemTextStyled = styled(ListItemText)({
  fontSize: '14px',
  color: '#424242',
});

export default function BottomAppBarWithNavigation({ data }) {
  console.log('Contenido de la prop data:', data);
  let correo_electronico, nombre, foto_perfil_url;
  if (data && data.length > 0) {
    // Extraer datos del primer elemento (índice 0)
    ({ correo_electronico, nombre, foto_perfil_url } = data[0]);
  }

  const [isMenuOpen, setIsMenuOpen] = React.useState(false);
  const [openDialog, setOpenDialog] = React.useState(false);
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleMenuToggle = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const handleProfileClick = (event) => {
    setOpenDialog(true);
    setAnchorEl(event.currentTarget);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
  };

  return (
    <div>
      <StyledAppBar>
        <Toolbar>
          <CenteredBox>
            <IconButton size="large" edge="start" color="#1976D2" aria-label="open drawer" onClick={handleMenuToggle}>
              <MenuIcon />
            </IconButton>
            <HomeIconButton size="large" color="#fff" aria-label="edit" style={{ marginLeft: '0px', marginTop: '-50px' }}>
              <EditIcon />
            </HomeIconButton>
            <IconButton size="large" edge="end" color="#fff" aria-label="account" onClick={handleProfileClick}>
              <AccountCircleIcon />
            </IconButton>
          </CenteredBox>
        </Toolbar>
      </StyledAppBar>

      <Drawer variant="temporary" open={isMenuOpen} onClose={handleMenuToggle}>
        <List disablePadding sx={{ bgcolor: '#1976D2', height: '100%' }}>
          <ListItem key="user-info" sx={{ ...itemStyles, ...itemCategoryStyles, fontSize: 22, color: '#fff', justifyContent: 'flex-end' }}>
            <ListItem key="user-info">
              <ListItemIcon>
                <Avatar alt={nombre} src={foto_perfil_url} onClick={handleProfileClick} />
              </ListItemIcon>
            </ListItem>
          </ListItem>
          {/* ... (código anterior) */}
        </List>
      </Drawer>

      <div style={{ marginLeft: isMenuOpen ? '240px' : '0', padding: '16px', marginTop: '64px', transition: 'margin-left 0.3s ease-in-out' }}>
        {/* Aquí puedes agregar el contenido principal de tu aplicación */}
      </div>

      <Popover
        open={openDialog}
        anchorEl={anchorEl}
        onClose={handleCloseDialog}
        anchorOrigin={{
          vertical: 'bottom',
          horizontal: 'left',
        }}
        transformOrigin={{
          vertical: 'top',
          horizontal: 'left',
        }}
      >
        <Box p={2}>
          <Avatar alt={nombre} src={foto_perfil_url} sx={{ width: 60, height: 60, marginBottom: 2 }} />
          <ListItemTextStyled primary={`Nombre: ${nombre}`} />
          <ListItemTextStyled primary={`Correo Electrónico: ${correo_electronico}`} />
          {/* Agrega más detalles según tus necesidades */}
        </Box>
      </Popover>
    </div>
  );
}
